import React from 'react';
import {aidos} from '../overview/aidos.png'
import 'bootstrap/dist/css/bootstrap.css';
import './index.css'



function OverviewThreeComponent() {
    return (
        <div>
            <h4 className='center3'>Nominations</h4>
            <div class="container">
  <div class="row">
    <div className='box1'>
      <div class="col2"><img className='photo' src="https://www.linkpicture.com/q/WhatsApp-Image-2023-02-24-at-01.14.37.jpeg" alt="pic" /></div>
      <h6 class="col">Daryn FIRST Championship - Design Award 1st place</h6>
    </div>
    <div className='box2'>
      <div class="col2"><img className='photo' src="https://www.linkpicture.com/q/WhatsApp-Image-2023-02-23-at-12.29.36-1.jpeg" alt="pic" /></div>
      <h6 class="col">Haileybury FIRST Championship - Connect Award 1st place</h6>
    </div>
  </div>

</div>

        </div>
    );
}

export default OverviewThreeComponent;
